-- 修改字段的中文描述
ALTER TABLE mcp_asset_config MODIFY COLUMN asset_name varchar(20) COMMENT '资产名称,[如:BTC]';
-- 钱包表增加资产类型字段，修改状态字段的默认值
ALTER TABLE `mc_payment`.`mcp_wallet`
    ADD COLUMN `asset_type` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '资产类型,[0:加密货币,1:法定货币]' AFTER `account_id`,
MODIFY COLUMN `status` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '状态,[0:可用,1:锁定,2:冻结]' AFTER `remark`;
-- 资产配置表增加资产类型字段
ALTER TABLE `mc_payment`.`mcp_asset_config`
    ADD COLUMN `asset_type` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '资产类型,[0:加密货币,1:法定货币]' AFTER `id`;
-- 入金记录表增加资产类型字段，业务名称字段，回调地址字段，入金成功跳转页面地址字段
ALTER TABLE `mc_payment`.`mcp_deposit_record`
    ADD COLUMN `asset_type` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '资产类型,[0:加密货币,1:法定货币]' AFTER `id`,
ADD COLUMN `business_name` varchar(50) NOT NULL DEFAULT '' COMMENT '入金业务名称' AFTER `net_protocol`,
ADD COLUMN `webhook_url` varchar(255) NOT NULL DEFAULT '' COMMENT '回调地址' AFTER `fee_rate`,
ADD COLUMN `success_page_url` varchar(255) NOT NULL DEFAULT '' COMMENT '入金成功跳转页面地址' AFTER `webhook_url`;
-- 添加汇率目标币种字段
ALTER TABLE `mc_payment`.`mcp_deposit_record`
    ADD COLUMN `target_currency` varchar(20) NOT NULL DEFAULT 'USDT' COMMENT '汇率目标币种' AFTER `rate`;
-- 入金记录明细表增加资产类型字段
ALTER TABLE `mc_payment`.`mcp_deposit_record`
    ADD COLUMN `user_selectable` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '用户是否可选,[0:否,1:是]' AFTER `success_page_url`;
-- 添加汇率目标币种字段
ALTER TABLE `mc_payment`.`mcp_withdrawal_record`
    ADD COLUMN `target_currency` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'USDT' COMMENT '汇率目标币种' AFTER `fee_rate`;
-- 出金记录表增加回调地址字段
ALTER TABLE `mc_payment`.`mcp_withdrawal_record`
    ADD COLUMN `webhook_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '回调地址' AFTER `target_currency`;
-- 出金记录表增加资产类型字段
ALTER TABLE `mc_payment`.`mcp_withdrawal_record`
    ADD COLUMN `asset_type` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '资产类型,[0:加密货币,1:法定货币]' AFTER `id`;
-- 增加货币汇率表
CREATE TABLE `mcp_currency_rate` (
                                     `id` bigint NOT NULL,
                                     `base_currency` varchar(20) COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '基础货币代码，例如 USD',
                                     `target_currency` varchar(20) COLLATE utf8mb4_general_ci NOT NULL COMMENT '目标货币代码，例如 EUR',
                                     `exchange_rate` decimal(32,20) NOT NULL COMMENT '汇率，表示将一单位基础货币转换为目标货币的汇率',
                                     `create_by` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '创建人',
                                     `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
                                     `update_by` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '最后修改人',
                                     `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
                                     PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='货币汇率表';
